var lz=function(n,e){return (+n+Math.pow(10,e)+'').substr(1)}
var rb=function(){return Math.random()<0.5}
var rm=function(m){return ~~(Math.random()*m)}
var rr=function(n,x){return Math.round(Math.random()*(x-n))+n}
var rn=function(n,x){var r=Math.random();return !x?(!n?r<0.5:~~(r*n)):Math.round((r*(x-n))+n)}
var nc=function(n){return (n+'').replace(/\B(?=(?=\d*\.)(\d{3})+(?!\d))/g,',')}
var mc=function(n,d){d=d!==void(0)?d:2;return ('$'+n.toFixed(d)).replace(/\B(?=(?=\d*\.)(\d{3})+(?!\d))/g,',')}
var ro=function(a){var b=a.slice(0),c=[];while(b.length){c.push(b.splice(Math.floor(Math.random()*b.length),1)[0])}return c}
var fy=function(a){for(var b=a.slice(0),i=0,l=b.length,j,t;i<l;i++){j=~~(Math.random()*(l-i))+i;t=b[i];b[i]=b[j];b[j]=t}return b}
var as=function(a){var b=a.slice(0);b.sort(function(){return Math.random()-.5});return b}
var td=function(){if(!td.t)td.t=new Date();else{td.r=new Date()-td.t;td.t=0;return td.r}}
var ni=function(n){return [].indexOf.call(n.parentNode.children, n)}
var mt=function(t,d){for(var i in d){t=t.replace(RegExp('\{\{'+i+'}}','g'),d[i]);}return t;}
//var mt=function(t,d){d.forEach(p=>t=t.replace(RegExp('\{\{'+i+'}}','g'),p);return t;}
var ra=function(r,s,c){for(var i in r)c=c.replace(r[i],s[i]);return c}
